DROP TABLE IF EXISTS `obsec_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `obsec_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `user_name` varchar(100) NOT NULL COMMENT '用户名',
  `corporate_name` varchar(100) DEFAULT NULL COMMENT '公司名称',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `login_id` int(2) DEFAULT '1' COMMENT '判断用户是否登录：1:未登录 2：登录',
  `register_type` int(2) DEFAULT NULL COMMENT '注册用户类型 1：个人用户 2：企业用户 3:系统用户',
  `register_time` datetime NOT NULL COMMENT '注册时间',
  `switch_type` int(2) NOT NULL DEFAULT '1' COMMENT '是否启用 1：启用 2：未启用',
  `content` varchar(100) DEFAULT NULL COMMENT '用户信息备注',
  `last_time` varchar(20) NOT NULL COMMENT '登陆时间',
  `session_id` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user` (`user_name`)
) ENGINE=InnoDB AUTO_INCREMENT=1577 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

